•
1 caja de porotos rojos @wasil_cl 
1/2 taza de cebolla en cubos
1/2 taza de choclo dulce de granado 
1 huevo 
4 cucharadas de harina de avena o cualquier harina 
Sal, pimienta, ajo

Preparación 🥘 
1. Deben agregar los porotos a una mini primer o procesadora, cuando se muelan agregar la avena y aliños. 
Luego agreguen la cebolla y el choclo hasta que se mezcle todo y en un sartén antiadherente con una cuchara ponen la mezcla hasta formar las hamburguesas, del tamaño y grosor que desean. Para que se cocinaran por arriba le puse una tapa al sartén, entonces al momento de darlas vuelta no se me desarmaron 🙌🏻💪🏻

Luego agréguenle los ingredientes que ustedes quieran para comer una deliciosa hamburguesa sin carne, yo le puse huevo, cheddar y palta. Obviamente mucho mucho ketchup soy fan número 1 🤭💕😋😁

Si preparan la receta recuerden etiquetarme y mandarme fotitos 📷 
